import Form from 'react-bootstrap/Form';
import React from 'react';
import { Button, Container } from 'react-bootstrap';
import styles from './styles.module.scss';

function Sell() {
  return (
    <>
      <h1 className={styles.title}>Token Sale</h1>

      <Container className={styles.inputs}>
        <Form>
          <Form.Group className='mb-3'>
            <Form.Label className={styles.label}>Send:</Form.Label>
            <Form.Control placeholder='Moneda1' disabled />
          </Form.Group>
          <Form.Group className='mb-3'>
            <Form.Label className={styles.label}>Receive:</Form.Label>
            <Form.Control placeholder='Moneda2' disabled />
          </Form.Group>
          <Button className={styles.buttonSell} type='submit'>
            Sell
          </Button>
        </Form>
      </Container>
    </>
  );
}

export default Sell;
